import React, { Component } from "react";
import Coins from "../components/Coins";

class App extends Component {
  constructor() {
    super();
    this.state = {
      coins_data: [],
    };
  }

  componentDidMount() {
    fetch("https://swapi.dev/api/people")
    .then((response) => response.json())
    .then((data) => this.setState({ coins_data: data["results"] }));
  }

  render() {
    let coin_arr=this.state.coins_data.map((val,inx)=>{
      return <Coins coin_prop={val} key={inx} />
    })
    return (
      <div>
        {coin_arr}
      </div>
    );
  }
}

export default App;
